        rows = table.find("tbody > tr").get()
        columnIndex = $(this).index() + 1

        rows.sort(function (a, b) {
            A = $(a).children("td").eq(columnIndex).text()
            B = $(b).children("td").eq(columnIndex).text()

            if (columnIndex === 1) {
                A = A.replace(/[0-9]/g, "").toUpperCase();
                B = B.replace(/[0-9]/g, "").toUpperCase();
            } else {
                A = parseInt(A);
                B = parseInt(B);
            }

            comparison = columnIndex === 1 ? A.localeCompare(B) : B - A

            if (comparison === 0 && columnIndex !== 1) {
                firstA = $(a).children("td").eq(1).text().replace(/[0-9]/g, "").toUpperCase()
                firstB = $(b).children("td").eq(1).text().replace(/[0-9]/g, "").toUpperCase()
                return firstA.localeCompare(firstB)
            }

            return comparison
        })

        $.each(rows, function (_, row) {
            table.children("tbody").append(row)
        })

        $("#stats > .stats > table > thead > tr > th").css("font-weight", "300")
        $("#stats > .stats > table > tbody > tr > td:nth-of-type(n+3)").css("font-weight", "300")
